INSERT INTO `htmlformentry_html_form` VALUES (70, 73, NULL, '<htmlform>\r\n    <style>\r\n        .section {\r\n            border: 1px solid $headerColor;\r\n            padding: 2px;\r\n            text-align: left;\r\n            margin-bottom: 1em;\r\n        }\r\n\r\n        .sectionHeader {\r\n            background-color: #2f1c55;\r\n            color: white;\r\n            /* display: block; */\r\n            padding: 2px;\r\n            font-weight: bold;\r\n        }\r\n\r\n        table tr:nth-child(even) {\r\n            background: #ffffff;\r\n        }\r\n\r\n        .alnright {\r\n            text-align: right;\r\n            color: #000000;\r\n            width: 25%;\r\n        }\r\n\r\n        .alnright_s {\r\n            text-align: right;\r\n            color: #000000;\r\n            width: 13%;\r\n        }\r\n\r\n        .alnleft_s {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 13%;\r\n        }\r\n\r\n        .alnleft_j {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 20%;\r\n        }\r\n\r\n        .alnleft {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 25%;\r\n        }\r\n\r\n        .error {\r\n            color: red;\r\n        }\r\n\r\n        td {\r\n            border: none;\r\n        }\r\n\r\n        table th, table td {\r\n            padding: 5px 10px;\r\n            border: None;\r\n        }\r\n\r\n        .legend_style {\r\n            max-width: 35%;\r\n            background: #FAFAFA;\r\n            <!-- padding: 5px; -->\r\n            margin: 0px left;\r\n            box-shadow: 1px 1px 25px rgba(0,0,0,0.10);\r\n            border-radius: 2px;\r\n            border: 1px solid #305a72;\r\n            border-bottom-left-radius: 2px;\r\n            text-transform: initial;\r\n        }\r\n\r\n        form fieldset, .form fieldset {\r\n            min-width: 98%;\r\n            border: none;\r\n            border-top: 1px solid #305a72;\r\n        }\r\n\r\n        table th, table td {\r\n            padding: 5px 10px;\r\n            /* border: 1px solid #DDD; */\r\n        }\r\n\r\n        table tr {\r\n            border: None;\r\n        }\r\n\r\n        ul.select, .form input, .form select, .form textarea, .form ul.select {\r\n            padding: 2px 10px;\r\n        }\r\n\r\n        form input, form select, form textarea, form ul.select, .form input, .form select, .form textarea, .form\r\n        ul.select {\r\n            padding: 2px 10px;\r\n        }\r\n\r\n        form select, .form select {\r\n            max-width: 150px;\r\n            min-width: 100px;\r\n        }\r\n\r\n        body {\r\n            font-family: \"OpenSans\", Arial, sans-serif;\r\n            color: #363463;\r\n            font-size: 14px;\r\n        }\r\n\r\n        .alnVertical {\r\n            vertical-align: top;\r\n        }\r\n        .td_overwrote {\r\n            border: 1px solid black;\r\n        }\r\n    </style>\r\n    <script type=\"text/javascript\">\r\n        beforeSubmit.push(function() {\r\n        var val_encounterDate = getValue(\'visit_date.value\');\r\n        var val_next_appointment = getValue(\'next_appointment.value\');\r\n        if (val_encounterDate > val_next_appointment) {\r\n        getField(\'next_appointment.error\').html(\'Next appointment date has to be later than visit date\').show();\r\n        return false;\r\n        }\r\n\r\n        return true;\r\n        });\r\n    </script>\r\n    <script type=\"text/javascript\">\r\n\r\n        var $ = jQuery;\r\n        $(document).ready(function () {\r\n           // $(\'.hasDatepicker\').attr(\'readonly\', true);\r\n        });\r\n$(document).ready(function ()\r\n	{\r\n	   $(\'#height\').keyup(calBMI);\r\n           $(\'#weight\').keyup(calBMI);\r\n           $(\'#length\').keyup(calBMI);\r\n	});\r\n\r\nfunction calBMI(){\r\n    var height_val = getValue(\'height.value\');\r\n    var weight_val = getValue(\'