INSERT INTO `htmlformentry_html_form` VALUES (72, 75, NULL, '<htmlform>\r\n    <style>\r\n        .section {\r\n            border: 1px solid $headerColor;\r\n            padding: 2px;\r\n            text-align: left;\r\n            margin-bottom: 1em;\r\n        }\r\n\r\n        .sectionHeader {\r\n            background-color: #2f1c55;\r\n            color: white;\r\n            /* display: block; */\r\n            padding: 2px;\r\n            font-weight: bold;\r\n        }\r\n\r\n        table tr:nth-child(even) {\r\n            background: #ffffff;\r\n        }\r\n\r\n        .alnright {\r\n            text-align: right;\r\n            color: #000000;\r\n            width: 25%;\r\n        }\r\n\r\n        .alnright_s {\r\n            text-align: right;\r\n            color: #000000;\r\n            width: 13%;\r\n        }\r\n\r\n        .alnleft_s {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 13%;\r\n        }\r\n\r\n        .alnleft_j {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 20%;\r\n        }\r\n\r\n        .alnleft {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 25%;\r\n        }\r\n\r\n        .error {\r\n            color: red;\r\n        }\r\n\r\n        td {\r\n            border: none;\r\n        }\r\n\r\n        table th, table td {\r\n            padding: 5px 10px;\r\n            border: None;\r\n        }\r\n\r\n        .legend_style {\r\n            max-width: 35%;\r\n            background: #FAFAFA;\r\n            <!-- padding: 5px; -->\r\n            margin: 0px left;\r\n            box-shadow: 1px 1px 25px rgba(0,0,0,0.10);\r\n            border-radius: 2px;\r\n            border: 1px solid #305a72;\r\n            border-bottom-left-radius: 2px;\r\n            text-transform: initial;\r\n        }\r\n\r\n        form fieldset, .form fieldset {\r\n            min-width: 98%;\r\n            border: none;\r\n            bor