ormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=a7612e61-9713-4c5c-a90d-d0d555a72f91&amp;returnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\";\r\n		\r\n		var href_risk=baseUrl+\r\n		\"/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=c50f3dda-754b-4fc5-9af9-0df15527b9e9&amp;returnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\";\r\n        var take = $(\'#imm\')\r\n        take.attr(\"href\",href_imm);\r\n\r\n        var ref = $(\'#referral\')\r\n        ref.attr(\"href\",href_referral);\r\n		\r\n		var risk = $(\'#risk\')\r\n			risk.attr(\"href\",href_risk);\r\n        });\r\n        \r\n    </script>\r\n\r\n\r\n\r\n    <table class=\"baseline-aligned\">\r\n        <tr><td>HIV Testing Services</td></tr>\r\n        <tr>\r\n            <td>\r\n                <div id=\"home-container\">\r\n                    <div id=\"apps\">\r\n\r\n                     \r\n                        <a id=\"imm\"\r\n                                 href=\"/baseUrl/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=&amp;visitId=&amp;formUuid=4c7b91dd-4836-4794-b752-8d783101ac36&amp;returnUrl=%2F+domain+%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3Db050b4b9-6786-4e69-93b6-82b641cc4fc0%26encounterId%3D1242%26encounterId%3D1258%26\"\r\n\r\n class=\"button app big\">\r\n\r\n\r\n                            <i class=\"icon-calendar\"></i>\r\n\r\n                           Child Immunization\r\n                        </a>\r\n						<a id=\"referral\"\r\n                           href=\"/baseUrl/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=&amp;visitId=&amp;formUuid=a7612e61-9713-4c5c-a90d-d0d555a72f91&amp;returnUrl=%2F+domain+%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3Db050b4b9-6786-4e69-93b6-82b641cc4fc0%26encounterId%3D1242%26encounterId%3D1258%26\"\r\n                           class=\"button app big hts\">\r\n\r\n                            <i class=\"icon-exchange\"></i>\r\n\r\n                         Malaria, Daily ANC Form\r\n                        </a>\r\n						<a id=\"risk\"\r\n                           href=\"/baseUrl/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=&amp;visitId=&amp;formUuid=c50f3dda-754b-4fc5-9af9-0df15527b9e9&amp;returnUrl=%2F+domain+%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3Db050b4b9-6786-4e69-93b6-82b641cc4fc0%26encounterId%3D1242%26encounterId%3D1258%26\"\r\n                           class=\"button app big hts\">\r\n\r\n                            <i class=\"icon-list\"></i>\r\n\r\n                           Adult Risk Stratification\r\n                        </a>\r\n                    </div>\r\n\r\n                </div>\r\n            </td>\r\n\r\n        </tr>\r\n\r\n    </table> 	 \r\n\r\n<div class=\"show\"> Malaria OPD form must be filled before you access other forms</div>\r\n\r\n <ifMode mode=\"\" include=\"false\">\r\n        <lookup complexExpression=\"\r\n            #set( $encounter = 0 )\r\n            #set( $encounter = $fn.latestEncounter(\'afcc6dbb-afce-4fcd-b91f-aa4801805400\'))\r\n            #if( $encounter == 0 )\r\n                &lt;script type=&quot;text/javascript&quot;>\r\n                       $(\'.imm\').hide();\r\n                       $(\'.show\').show()\r\n\r\n\r\n\r\n                &lt;/script>\r\n            #end\"/>\r\n</ifMode>\r\n</htmlform>', 1, '2020-12-12 16:24:29', 1, '2020-12-21 04:43:50', 0, '1a6a098c-ac8c-4269-8466-8fcd8efcf65b', NULL, NULL, NULL, NULL);
INSERT INTO `htmlformentry_html_form` VALUES (78, 81, NULL, '<htmlform>\r\n    <style>\r\n        .section {\r\n            border: 1px solid $headerColor;\r\n            padding: 2px;\r\n            text-align: left;\r\n            margin-bottom: 1em;\r\n        }\r\n\r\n        .sectionHeader {\r\n            background-color: #2f1c55;\r\n            color: white;\r\n            /* display: block; */\r\n            padding: 2px;\r\n            font-weight: bold;\r\n        }\r\n\r\n        table tr:nth-child(even) {\r\n            background: #ffffff;\r\n        }\r\n\r\n        .alnright {\r\n            text-align: right;\r\n            color: #000000;\r\n            width: 25%;\r\n        }\r\n\r\n        .alnright_s {\r\n            text-align: right;\r\n            color: #000000;\r\n            width: 13%;\r\n        }\r\n\r\n        .alnleft_s {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 13%;\r\n        }\r\n\r\n        .alnleft_j {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 20%;\r\n        }\r\n\r\n        .alnleft {\r\n            text-align: left;\r\n            color: #000000;\r\n            width: 25%;\r\n        }\r\n\r\n        .error {\r\n            color: red;\r\n        }\r\n\r\n        td {\r\n            border: none;\r\n        }\r\n\r\n        table th, table td {\r\n            padding: 5px 10px;\r\n            border: None;\r\n        }\r\n\r\n        .legend_style {\r\n            max-width: 35%;\r\n            background: #FAFAFA;\r\n            <!-- padding: 5px; -->\r\n            margin: 0px left;\r\n            box-shadow: 1px 1px 25px rgba(0,0,0,0.10);\r\n            border-radius: 2px;\r\n            border: 1px solid #305a72;\r\n            border-bottom-left-radius: 2px;\r\n            text-transform: initial;\r\n        }\r\n\r\n        form fieldset, .form fieldset {\r\n            min-width: 98%;\r\n            border: none;\r\n            border-top: 1px solid #305a72;\r\n        }\r\n\r\n        table th, table td {\r\n            padding: 5px 10px;\r\n            /* border: 1px solid #DDD; */\r\n        }\r\n\r\n        table tr {\r\n            border: None;\r\n        }\r\n\r\n        ul.select, .form input, .form select, .form textarea, .form ul.select {\r\n            padding: 2px 10px;\r\n        }\r\n\r\n        form input, form select, form textarea, form ul.select, .form input, .form select, .form textarea, .form\r\n        ul.select {\r\n            padding: 2px 10px;\r\n        }\r\n\r\n        form select, .form select {\r\n            max-width: 150px;\r\n            min-width: 100px;\r\n        }\r\n\r\n        body {\r\n            font-family: \"OpenSans\", Arial, sans-serif;\r\n            color: #363463;\r\n            font-size: 14px;\r\n        }\r\n\r\n        .alnVertical {\r\n            vertical-align: top;\r\n        }\r\n        .td_overwrote {\r\n            border: 1px solid black;\r\n        }\r\n    \r\n#customers {\r\n  font-family: Arial, Helvetica, sans-serif;\r\n  border-collapse: collapse;\r\n  width: 100%;\r\n}\r\n\r\n#customers td, #customers th {\r\n  border: 1px solid #ddd;\r\n  padding: 8px;\r\n}\r\n\r\n#customers tr:nth-child(even){background-color: #f2f2f2;}\r\n\r\n#customers tr:hover {background-color: #ddd;}\r\n\r\n#customers th {\r\n  padding-top: 12px;\r\n  padding-bottom: 12px;\r\n  text-align: left;\r\n  background-color: #4CAF50;\r\n  color: white;\r\n}\r\n</style>\r\n    <script type=\"text/javascript\">\r\n        beforeSubmit.push(function() {\r\n        var val_encounterDate = getValue(\'visit_date.value\');\r\n        var val_next_appointment = getValue(\'next_appointment.value\');\r\n        if (val_encounterDate > val_next_appointment) {\r\n        getField(\'next_appointment.error\').html(\'Next appointment date has to be later than visit date\').show();\r\n        return false;\r\n        }\r\n\r\n        return true;\r\n        });\r\n    </script>\r\n    <script type=\"text/javascript\">\r\n\r\n        var $ = jQuery;\r\n        $(document).ready(function () {\r\n           // $(\'.hasDatepicker\').attr(\'readonly\', true);\r\n        });\r\n$(document).ready(function ()\r\n	{\r\n	   $(\'#height\').keyup(calBMI);\r\n           $(\'#weight\').keyup(calBMI);\r\n           $(\'#length\').keyup(calBMI);\r\n	});\r\n\r\nfunction calBMI(){\r\n    var height_val = getValue(\'height.value\');\r\n    var weight_val = getValue(\'weight.value\');\r\n    var length_val = getValue(\'length.value\');\r\n    var height_num = parseFloat(height_val);\r\n    var weight_num = parseFloat(weight_val);\r\n    var length_num = parseFloat(length_val);\r\n    if(!isNaN(height_num)){\r\n        if(!isNaN(weight_num)){\r\n            height_num = height_num/100;\r\n            var bmi_val = weight_num / (height_num * height_num);\r\n            setValue(\'bmi.value\',bmi_val.toFixed(2));\r\n        }\r\n        else{\r\n            setValue(\'bmi.value\', \"\");\r\n        }\r\n    }\r\n    else if(!isNaN(length_num)){\r\n        if(!isNaN(weight_num)){\r\n            length_num  = length_num/100;\r\n            var bmi_val = weight_num / (length_num* length_num);\r\n            setValue(\'bmi.value\',bmi_val.toFixed(2));\r\n        }\r\n        else{\r\n            setValue(\'bmi.value\', \"\");\r\n        }\r\n}\r\n    else {\r\n        setValue(\'bmi.value\', \"\");\r\n    }\r\n\r\n    if(height_val.length > 0){\r\n        setValue(\'length.value\', \"\");\r\n       $(\'#length\').hide(200);\r\n}\r\n    else{\r\n        $(\'#length\').show(200);\r\n}\r\n\r\n    if(length_val.length > 0){\r\n setValue(\'height.value\', \"\");\r\n$(\'#height\').hide(200);\r\n}\r\n    else{\r\n        $(\'#height\').show(200);\r\n}\r\n}\r\n    </script>\r\n   <!-- <div class=\"hidden\" id=\"encounter-details\" sectionTag=\"section\" headerStyle=\"title\" headerLabel=\"Encounter Details\">\r\n        <fieldset>\r\n            <legend class=\"legend_style\">When?</legend>\r\n            <label>When?</label>\r\n            <encounterDate default=\"now\" showTime=\"false\" allowFutureDates=\"false\" />\r\n        </fieldset>\r\n\r\n        <fieldset>\r\n            <legend>Who?</legend>\r\n            <label>Who?</label>\r\n            <encounterProviderAndRole default=\"currentUser\" encounterRole=\"240b26f9-dd88-4172-823d-4a8bfeb7841f\"\r\n                                      required=\"true\" />\r\n        </fieldset>\r\n\r\n        <fieldset>\r\n            <legend>Where?</legend>\r\n            <label>Where?</label>\r\n            <encounterLocation default=\"SessionAttribute:emrContext.sessionLocationId\" />\r\n        </fieldset>\r\n    </div>-->\r\n    <script type=\"text/javascript\">\r\n        <!--jQuery(function() {-->\r\n        <!--&lt;!&ndash;Hide the following questions when the form loads&ndash;&gt;-->\r\n        <!--htmlForm.simpleUi.hideField(\'familyr\'); htmlForm.simpleUi.hideField(\'familyro\');-->\r\n        <!--});-->\r\n    </script>\r\n    <table style=\"margin-bottom: 20px;\">\r\n        <thead>\r\n            <tr>\r\n                <th style=\"text-align: center\">Malaria, Daily OPD Form(NHMIS/HF/OPD)</th>\r\n            </tr>\r\n        </thead>\r\n    </table>\r\n\r\n\r\n    <fieldset style=\"border: 1px solid #305a72; min-width: 90%; margin-left:5%; padding: 6px; margin-bottom: 2%; border-radius: 9px;\">\r\n        <legend class=\"legend_style\">Last Clinical Parameters</legend>\r\n        <table id=\"dashboard\" cellspacing=\"10\" cellpadding=\"5\" align=\"center\">\r\n\r\n            <tr><td><b>Weight:</b><font color=\'blue\' style=\"font-weight: bold\"><lookup expression=\"fn.latestObs(\'5089\').valueNumeric\" /></font>kg <lookup expression=\"fn.latestObs(\'5089\').obsDatetime\" /></td><td><b>Height:</b><font color=\'blue\' style=\"font-weight: bold\"><lookup expression=\"fn.latestObs(\'5090\').valueNumeric\" /></font> cm <lookup expression=\"fn.latestObs(\'5090\').obsDatetime\" /></td></tr>\r\n        </table>\r\n    </fieldset>\r\n    <div class=\"hidden\" id=\"encounter-details\" sectionTag=\"section\" headerStyle=\"title\" headerLabel=\"Encounter Details\">\r\n        <fieldset>\r\n            <legend class=\"legend_style\">When?</legend>\r\n            <label>When?</label>\r\n            <encounterDate default=\"now\" showTime=\"false\" allowFutureDates=\"false\" />\r\n        </fieldset>\r\n        <fieldset>\r\n            <legend>Who?</legend>\r\n            <label>Who?</label>\r\n            <encounterProviderAndRole default=\"currentUser\" encounterRole=\"240b26f9-dd88-4172-823d-4a8bfeb7841f\" required=\"true\" />\r\n        </fieldset>\r\n        <fieldset>\r\n            <legend>Where?</legend>\r\n            <label>Where?</label>\r\n            <encounterLocation default=\"SessionAttribute:emrContext.sessionLocationId\" />\r\n        </fieldset>\r\n    </div>\r\n\r\n\r\n    <table>\r\n        <tr>\r\n            <td class=\"alnright\">Visit Date</td>\r\n            <td>\r\n                <encounterDate  id=\"visit_date\" showTime=\"false\" allowFutureDates=\"false\" required=\"true\" />\r\n            </td>\r\n            \r\n        </tr>\r\n    </table>\r\n\r\n    \r\n<fieldset>\r\n\r\n\r\n       \r\n		<legend class=\"legend_style\">Current Visit Details</legend>\r\n                          <table width=\"100%\">\r\n            \r\n              <tr>  \r\n                               \r\n                \r\n                            \r\n                  <td class=\"alnleft_s\">\r\n                    <enrollInProgram programId=\"5\" />\r\n                    </td> \r\n\r\n\r\n               \r\n                <td class=\"alnleft_s\">Type of Attendance</td>\r\n				<td class=\"alnright_s\">\r\n                                <obs conceptId=\"164181\" answerConceptIds=\"164180,160530\" answerLabels=\"New,Follow up\"/> \r\n				</td>\r\n				\r\n                           <includeIf velocityTest=\"$patient.gender == \'F\' \">\r\n\r\n                               <td class=\"alnleft_s\">Pregnancy Status</td>\r\n				<td class=\"alnright_s\">\r\n                                <obs conceptId=\"165050\" answerConceptIds=\"165048,165047\" answerLabels=\"Pregnant,Not Pregnant\" required=\"true\"/> \r\n				</td>\r\n			\r\n                           </includeIf>\r\n\r\n            </tr>\r\n			</table>\r\n\r\n\r\n\r\n     <table>\r\n\r\n            <tr>\r\n                <td class=\"alnleft_s\">Presenting Complaint</td>\r\n                <td class=\"alnright_s\"><obs conceptId=\"165680\" style=\"textarea\" rows=\"6\" cols=\"50\"/></td>\r\n               <td class=\"alnleft_s\">Diagnosis</td>\r\n                <td class=\"alnright_s\"><obs conceptId=\"166259\" style=\"textarea\" rows=\"3\" cols=\"30\"/></td>\r\n               \r\n               \r\n				\r\n            </tr> \r\n\r\n                   <tr>\r\n\r\n                <td class=\"alnleft_s\">Drug Given</td>\r\n                <td class=\"alnright_s\"><obs conceptId=\"166261\" style=\"textarea\" rows=\"3\" cols=\"14\"/></td>\r\n                 <td class=\"alnleft_s\">Outcome of Visit</td> \r\n                 <td > <obs conceptId=\"166295\" answerConceptIds=\"166293,166292,165343,160432\" answerLabels=\"Not  Treated,Treated,Admitted,Dead\" required=\"true\"/></td>\r\n                   </tr>\r\n\r\n </table><table>\r\n			<tr>\r\n	\r\n	<td class=\"alnright_s\"> Clinical Diagnosis only</td>\r\n		<td class=\"alnleft_s\" colspan=\"3\"> <obs conceptId=\"397\" answerConceptIds=\"1065,1066\" answerLabels=\"Yes,No\"/></td>\r\n	<td class=\"alnright_s\"> Rapid Test for Malaria (RDT)</td>\r\n	<td class=\"alnleft_s\"> \r\n         <obs conceptId=\"1643\" answerConceptIds=\"703,664\" answerLabels=\"Positive,Negative\" /></td>	\r\n          <td class=\"alnright_s\"> Microscopy</td>\r\n          <td class=\"alnleft_s\"> \r\n          <obs conceptId=\"166310\" answerConceptIds=\"703,664\" answerLabels=\"Positive,Negative\" /></td>	             