INSERT INTO `htmlformentry_html_form` VALUES (79, 82, NULL, '<htmlform>\r\n    <!-- Autogenerated example form  (template from 01-Nov-2010 -->\r\n    <macros>\r\n        paperFormId = (Fill this in)\r\n        headerColor =#009d8e\r\n        fontOnHeaderColor = white\r\n    </macros>\r\n\r\n    <style>\r\n        .section {\r\n        border: 1px solid $headerColor;\r\n        padding: 2px;\r\n        text-align: left;\r\n        margin-bottom: 1em;\r\n        }\r\n        .sectionHeader {\r\n        background-color: $headerColor;\r\n        color: $fontOnHeaderColor;\r\n        display: block;\r\n        padding: 2px;\r\n        font-weight: bold;\r\n        }\r\n        table.baseline-aligned td {\r\n        vertical-align: baseline;\r\n        }\r\n        .button.app, button.app, input[type=\"submit\"].app, input[type=\"button\"].app, input[type=\"submit\"].app, a.button.app {\r\n        width: 140px !important;\r\n        }\r\n    </style>\r\n    <script type=\"text/javascript\">\r\n        jQuery(document).ready(function ($) {\r\nvar getUrl = window.location;\r\nvar baseUrl = getUrl .protocol + \"//\" + getUrl.host + \"/\" + getUrl.pathname.split(\'/\')[1];\r\nvar domain = getUrl.pathname.split(\'/\')[1];\r\n        $.urlParam = function(name){\r\n        var results = new RegExp(\'[\\?&amp;]\' + name + \'=([^&amp;#]*)\').exec(window.location.href);\r\n        if (results==null){\r\n        return null;\r\n        }\r\n        else{\r\n        return decodeURI(results[1]) || 0;\r\n        }\r\n        }\r\n\r\n        href_art=baseUrl+\"/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=4c7b91dd-4836-4794-b752-8d783101ac36&amp;returnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\"\r\n\r\n        href_gat=baseUrl+\"/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=5fb70fa4-826e-4b7f-9179-22d437bf17a4&amp;\r\nreturnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\"\r\n\r\n\r\n        href_opd=baseUrl+\"/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=6bc064fa-a4aa-4437-9d3f-466b7337cfdd&amp;returnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\"\r\n        href_ipc=baseUrl+\"/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=ad2847a1-6efb-4947-940b-f1d296ee5019&amp;returnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\"\r\n\r\n href_anc=baseUrl+\"/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=a7612e61-9713-4c5c-a90d-d0d555a72f91&amp;returnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\"\r\n\r\n href_sm=baseUrl+\"/htmlformentryui/htmlform/enterHtmlFormWithStandardUi.page?patientId=\"+$.urlParam(\'patientId\')+\"&amp;visitId=&amp;formUuid=d5cf8ca3-b6d6-40a9-b99a-270e51a23de6&amp;returnUrl=%2F\"+domain+\"%2Fcoreapps%2Fclinicianfacing%2Fpatient.page%3FpatientId%3D\"+$.urlParam(\'patientId\')+\"%26\"\r\n\r\n\r\n\r\n\r\n\r\n\r\n        var t = $(\'#art\')\r\n        t.attr(\"href\",href_art)\r\n\r\n         \r\n        var ga = $(\'#gat\')\r\n        ga.attr(\"href\",href_gat)\r\n\r\n        var pd = $(\'#opd\')\r\n        pd.attr(\"href\",href_opd)\r\n         var an = $(\'#anc\')\r\n        an.attr(\"href\",href_anc)\r\n        var s = $(\'#sm\')\r\n        s.attr(\"href\",href_sm)\r\n        var pc = $(\'#ipc\')\r\n        pc.attr(\"href\",href_ipc)\r\n        })\r\n         ;\r\n    </script>\r\n\r\n    <table class=\"baseli