          class=\"button app big\">\r\n\r\n                            <i class=\"icon-signin \"></i>\r\n\r\n                           General Inpatient Care (IPC)\r\n                        </a>\r\n\r\n\r\n                          <a id=\"sm\"\r\n                           href=\"/baseUrl/coreapps/findpatient/findPatient.page?app=referenceapplication.vitals\"\r\n                           class=\"button app big\">\r\n\r\n                            <i class=\"icon-vitals\"></i>\r\n\r\n                          Severe Malaria Treatment\r\n                        </a>\r\n\r\n\r\n\r\n                    <includeIf velocityTest=\"$patient.gender == \'F\' \">\r\n                         <a id=\"anc\"\r\n                           href=\"/baseUrl/coreapps/findpatient/findPatient.page?app=referenceapplication.vitals\"\r\n                           class=\"button app big\">\r\n\r\n                            <i class=\"icon-baby\"></i>\r\n\r\n                           General Antenatal Care (ANC)\r\n                        </a>\r\n                       \r\n                    </includeIf>\r\n\r\n\r\n\r\n\r\n\r\n           <!--             <a id=\"gbv\"\r\n                           href=\"/baseUrl/appointmentschedulingui/home.page\" class=\"button app big\">\r\n\r\n                            <i class=\"icon-calendar\"></i>\r\n\r\n                            GBV\r\n                        </a> -->\r\n\r\n\r\n                     \r\n\r\n\r\n                    </div>\r\n\r\n                </div>\r\n            </td>\r\n\r\n        </tr>\r\n\r\n    </table>\r\n \r\n\r\n</htmlform>', 1, '2020-12-18 16:50:51', 1, '2020-12-18 16:57:03', 0, '84006c09-e109-4733-b2d1-5a397486d1c9', NULL, NULL, NULL, NULL);
